import { FormControlLabel, Radio, TextField, Typography } from '@mui/material';
import KeywordCheckTable from './KeywordCheckTable';
import Button from '@mui/material/Button'
import { useEffect, useState } from 'react';
import {DataItem}from './KeywordCheckTable';
import KeywordRegistStatusList, { KeywordJobStatusMap } from '../constants/KeywordRegistStatusList';
import {GridCellParams,GridColDef } from '@mui/x-data-grid';
import { siteNo } from '../api/keywordJob';

export default function KeywordCheck(){
      const styles1 = {
        width:'1510px',
        height:'80px',
        display:'flex',
      };

      const [searchText, setSearchText] = useState('');

      const handleSearchTextChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setSearchText(event.target.value);
      };
      const columns: GridColDef[] = [
        { 
            field: 'createdAt', headerName: '신청일', width: 100,headerAlign: 'center',
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
              },
              renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
              ),
            },
        { field: 'mediaName', headerName: '광고상품', width: 150 },
        { field: 'type', headerName: '작업구분', width: 100},
        { field: 'name', headerName: '작업명', width: 150 },
        { field: 'status', headerName: '작업상태', width: 100},
        {
            field: 'startAt', headerName: '수행시작', width: 110 ,           
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
            },
            renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
            ),
        },
        { 
            field: 'endAt', headerName: '수행종료', width: 110,
            valueGetter: (params) => {
                const { createdAt } = params.row;
                const date = createdAt.split(' ')[0];
                const time = createdAt.split(' ')[1];
                return `${date}<br />${time}`;
            },
            renderCell: (params) => (
                <div dangerouslySetInnerHTML={{ __html: params.value }} />
            ),},
        {
            field: 'registfile',
            headerName: '등록파일',
            width: 100,
            renderCell: (params: GridCellParams) => (
              <Button variant="outlined" color="error">
                다운로드
              </Button>
            ),
            headerAlign: 'center'
          },
          {
            field: 'fileresult',
            headerName: '결과',
            width: 100,
            renderCell: (params: GridCellParams) => (
              <Button variant="outlined" color="error">
                다운로드
              </Button>
            ),
            headerAlign: 'center'
          },
          {
            field: 'waitcancel',
            headerName: '대기취소',
            width: 100,
            renderCell: (params: GridCellParams) => (
              <Button variant="contained" disabled>
                취소
              </Button>
            ),
          },
        { field: 'createdBy', headerName: '요청자', width: 220,headerAlign: 'center'},
      ];

    const [data, setData] = useState<DataItem[]>([]);
    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await siteNo()
            const users: any = response.data;
            console.log(users);
            const contents: any[] = users.content;
            console.log(contents);
            const getStatusText = (status: string): string => {
                const matchedStatus = KeywordJobStatusMap[status];
                return matchedStatus ? matchedStatus.text : "";
              };
            const processedData = contents.map((item: any) => {
                const statusText = getStatusText(item.status);
                const formattedStatus = item.createdAt ? item.createdAt.replace('T', ' ') : '';
                const startText = item.startAt ? item.startAt.replace('T',' ') : '';
                const endText = item.endAt ? item.endAt.replace('T','') : '';
                const matchedtype = KeywordRegistStatusList.find(
                  (status) => status.value === item.type
                );
                const typeText = matchedtype ? matchedtype.text : ""; 
                return {
                  createdAt: formattedStatus,
                  mediaName: item.mediaName,
                  type: typeText,
                  name: item.name,
                  status: statusText,
                  startAt: startText,
                  endAt: endText,
                  fileName: item.keywordJobNo,
                  createdBy: item.createdBy,
                };
              });

              setData(processedData);
          } catch (error) {
            console.error('삐빅삐빅 에러입니다:', error);
          }
        };
        fetchData();
      }, []);
    return(
        <>
            <div style={styles1}>
                <div style={{width:'230px',height:'50px',marginTop:'20px',marginLeft:'700px'}}>
                <div style={{marginTop:'25px',fontWeight:'bold',fontSize:'13px',float:'left'}}>검색: </div>
                <TextField
                 id="outlined-basic" value={searchText}
                 onChange={handleSearchTextChange}
                 label={<Typography 
                 style={{fontSize:'13px',marginTop:'2px'}}>
                    검색어를입력하세유
                 </Typography>} variant="outlined" size="small" style={{marginTop:'10px',marginRight:'1px',float:'right'}}/>
                </div>
                <div style={{width:'360px',height:'50px',marginTop:'20px'}}>
                <div style={{marginLeft:'30px',marginTop:'25px',fontWeight:'bold',fontSize:'13px',float:'left'}}>작업:</div>
                {KeywordRegistStatusList.map((item)=>(
                    <FormControlLabel key={item.value}value="female" style={{marginTop:'13px'}} control={<Radio size="small" style= {{marginLeft:'5px'}}/>} label={<Typography style={{fontSize:'13px',marginLeft:'-6px'}}>{item.text}</Typography>}/>
                ))}
                </div>
                <Button variant="outlined" style={{width:'70px',height:'38px',marginTop:'30px'}} color="error">비우기</Button>
                <Button variant="outlined" style={{width:'90px',height:'38px',marginLeft:'10px',marginTop:'30px'}}>검색하기</Button>
            </div>
            <KeywordCheckTable/>

        </>
    );
}
